namespace RonSijm.FluidHumidifier.Factories.Route53;

public class HostedZoneFactory(string resourceName = null, Action<Humidifier.Route53.HostedZone> factoryAction = null) : ResourceFactory<Humidifier.Route53.HostedZone>(resourceName)
{

    internal List<InnerHostedZoneHostedZoneTagFactory> HostedZoneTagsFactories { get; set; } = [];

    internal List<InnerHostedZoneVPCFactory> VPCsFactories { get; set; } = [];

    internal InnerHostedZoneHostedZoneConfigFactory HostedZoneConfigFactory { get; set; }

    internal InnerHostedZoneQueryLoggingConfigFactory QueryLoggingConfigFactory { get; set; }

    protected override Humidifier.Route53.HostedZone Create()
    {
        var hostedZoneResult = CreateHostedZone();
        factoryAction?.Invoke(hostedZoneResult);

        return hostedZoneResult;
    }

    private Humidifier.Route53.HostedZone CreateHostedZone()
    {
        var hostedZoneResult = new Humidifier.Route53.HostedZone
        {
            GivenName = InputResourceName,
        };

        return hostedZoneResult;
    }
    public override void CreateChildren(Humidifier.Route53.HostedZone result)
    {
        base.CreateChildren(result);

        result.HostedZoneTags = HostedZoneTagsFactories.Any() ? HostedZoneTagsFactories.Select(x => x.Build()).ToList() : null;
        result.VPCs = VPCsFactories.Any() ? VPCsFactories.Select(x => x.Build()).ToList() : null;
        result.HostedZoneConfig ??= HostedZoneConfigFactory?.Build();
        result.QueryLoggingConfig ??= QueryLoggingConfigFactory?.Build();
    }

} // End Of Class

